import { Parallax, ParallaxLayer } from '@react-spring/parallax'
import iphone from '../Assets/IphoneHome.png'

export default function () {
    return (
        <Parallax pages={2} >
            <ParallaxLayer
                offset={0}
                speed={2.5}
                style={{ display: 'flex', justifyContent: 'end', alignItems:'end' }}>
                <img src={iphone}></img>
            </ParallaxLayer>
        </Parallax>
    )
}
